import {Button, TextField, Form, FormLayout} from '@shopify/polaris';
import {useCallback, useState} from "react";
import ReCAPTCHA from "react-google-recaptcha";

const Login: React.FC<any> = () => {
    const [email, setEmail] = useState('');

    const handleSubmit = useCallback((_event) => {
        setEmail('');
    }, []);

    const handleEmailChange = useCallback((value) => setEmail(value), []);
    return (
        <div className={'login'}>
            <div className={'wrapper-form-login'}>
                <div className={'login-title'}>Member Login</div>
                <Form onSubmit={handleSubmit}>
                    <FormLayout>
                        <TextField onChange={handleEmailChange} label='' type='text' placeholder={'Email'}/>
